bh_pri_LAYERDESC:
at 720 m: change back to cored section;
CALCAREOUS MARL, slightly silty, dark grey to medium grey, moderately fossiliferous (bioclasts, some sponges, bivalves, belemnites, crinoids), moderately bioturbated;
at the top (from 720.00 m to 720.07 m): LIMESTONE (wackestone, micrite), beige grey, bioturbated;
at 721.20 m and at 721.60 m: belemnite; at 720.07 m, 720.60 m, 721.55 m: pyrite nodule

BIOCLASTIC CALCAREOUS MARL, dark grey to dark greyish brown, with LIMESTONE nodules, very fossiliferous (sponges [size max. 12 cm], both dispersed and concentrated in layers at
the base of the marls, echinoderms), laminated, in sections slightly bioturbated;
interbeds (<10 - 35 cm) of LIMESTONE (mudstone, pelmicrite), dark greyish brown, sponge detritus sparse, in sections bioturbated;
at 709.10 m, 710.80 m, 711.23 m, 711.80 m: belemnites;
at 709.35 m: brachiopod;
at 711.51 m: ammonite;
at 711.97 m: change from cored to destructively drilled section

BIOCLASTIC LIMESTONE (wackestone and packstone, biopelmicrite), mostly dark greyish brown and medium grey, rarely beige grey, very fossiliferous (sponges [size max. a few cm],
echinoderms), mostly medium bedded (10 - 90 cm), bioturbated from 700.85 m to 701.85 m;
interbeds (max. 16 cm) of CALCAREOUS MARL, dark grey to black, partly with peloids (sponge tuberoids?), very fossiliferous (sponges, echinoderms, brachiopods), laminated, slightly
bioturbated;
in LIMESTONE sponges getting both less and smaller from top to the base of the beds, therefore transition from packstone to wackestone, rarely to mudstone;
at 700.19 m: belemnite

LIMESTONE (mudstone and wackestone, pelmicrite), mottled with medium grey and beige grey, in sections many peloids (sponge tuberoids?), medium bedded, intensely bioturbated;
regularly interbedded (max. 4 cm) by CLAYSTONE, calcareous, black;
at 693.78 m: echinoderm fragments (size ca. 1 mm);
from 694.23 m to 696.43 m: ARGILLACEOUS MARL, dark grey, fossiliferous (belemnites), laminated

LIMESTONE (wackestone, pelmicrite), dolomitic, beige grey, very sparsely fossiliferous (a few bivalves), medium bedded (20-90 cm); with
thin (max. 1 cm) interbeds of CLAYSTONE, silty, dark grey to black;
at 595.00 m and at 595.95 m: vug (size ca. 1 mm), open;
at 594.86 m, 596.40 m, 596.55 m, 596.95 m, 597.43 m, 597.67 m, 597.90 m: chert nodule

BIOHERMAL LIMESTONE (packstone and boundstone, biomicrite), medium grey to beige grey, moderately to very fossiliferous (vugs as fossil ghosts of sponges [sponge bioherm] getting
very frequent and bigger than 1 cm below 592.20 m, partly filled with MARL, dark greyish brown), thick bedded, partly brecciated with open vugs from 592.50 m to 593.10 m;
at 593.15 m: chert nodule;
from 593.38 m to 593.50 m: CLAYSTONE, dark greyish brown, laminated

LIMESTONE (mudstone and wackestone, biopelmicrite), medium grey to beige grey, fossiliferous (some sponges, bioclasts sparse), thick bedded down to 589.73 m, below 589.73 m
medium bedded (50 - 60 cm);
at 586.92 m, 587.30 m, 588.06 m, 588.14 m, 588.22 m, 589.43 m, 590.40 m: chert nodule

BIOHERMAL LIMESTONE (boundstone, biopelmicrite), mottled with dark beige and light grey, very fossiliferous (sponges abundant [sponge bioherm], bioclasts [bivalves?]), thick bedded,
vugs (mm-sized), open;
at 584.75 m and at 585.05 m: glauconite;
at 585.53 m and at 586.06 m: chert nodule

LIMESTONE (wackestone, biopelmicrite), dolomitic, mottled with dark beige and light grey, moderately fossiliferous (layers of bioclasts [bivalves?], a few layers [max. 1 cm] of sponges at
the top), thick bedded;
from 582.44 m to 583.17 m: vugs;
at 583.35 m: brachiopod;
at 583.60 m, 583.85 m, 584.15 m: chert nodule

BIOHERMAL LIMESTONE (boundstone, biomicrite, now mostly saccharoidal), mottled with dark beige and light grey, very fossiliferous (sponges abundant [sponge bioherm], bivalves
sparse), partly massive, breccia-like appearance with fissured and vuggy framework, partly irregularly medium bedded (10 - 80 cm);
at 565.00 m: pyrite nodule

LIMESTONE (wackestone, biopelmicrite), dark beige, subordinate light grey, moderately fossiliferous (dispersed sponges, bivalves sparse), medium bedded (10 - 40 cm);
at 580.30 m: pyrite nodule;
at 580.95 m, 581.93 m, 582.44 m: chert nodule;
at 581.35 m: layer of chert nodules

BIOHERMAL LIMESTONE (saccharoidal), beige grey, very fossiliferous (sponge detritus frequent, both dispersed and concentrated in layers [sponge bioherm], bivalves sparse), medium to
thick bedded;
from 552.40 m to 555.22 m and at 556.00 m: vugs;
at 555.57 m: crinoid;
at 556.18 m: belemnite;
at 557.57 m: pyrite nodule

LIMESTONE (saccharoidal), beige to beige grey, moderately fossiliferous (in sections sponges, bioclasts sparse), medium bedded (20 - 50 cm) down to 547.40 m, below 547.40 m medium
to thick bedded;
at 544.80 m, 544.95 m, 545.20 m, 545.77 m, 546.96 m, 549.65 m, 550.06 m: chert nodule;
at 550.38 m: pyrite nodule;
at 552.00 m: layer of chert nodules

BIOHERMAL LIMESTONE (saccharoidal), beige to beige grey, moderately to very fossiliferous (sponge detritus frequent both dispersed and concentrated in layers [sponge bioherm],
bivalves sparse), medium bedded (20 - 50 cm);
at 540.00 m: pyrite nodule;
at 541.25 m, 542.25 m, 543.40 m, 543.97 m: chert nodule;
from 541.60 m to 543.97 m: vugs

SILTY MARL, partly sandy (fine-grained), dark beige to beige, greyish pink, rarely reddish brown; and
SANDSTONE (fine- to medium-grained), very light grey, beige, moderately to well sorted, moderately cemented (calcite);
very subordinate CLAYSTONE, calcareous, partly sandy (medium-grained), reddish brown

SANDSTONE (fine- to medium-grained, rarely coarse-grained), calcareous, very light grey and beige, moderately sorted, poorly to moderately cemented (calcite);
very subordinate SILTSTONE, calcareous, dark beige to beige, greyish pink; in transition to
CLAYSTONE, partly sandy (fine-grained), reddish brown

LIMESTONE (saccharoidal), beige, medium bedded (40 - 60 cm) down to 536.58 m, below 536.58 m thick bedded;
from 532.73 m to 538.25 m: vertical karst fissures (aperture < 5 mm), dm in length, open;
at 533.83 m and at 535.04 m: layer of chert nodules;
from 536.58 m to 538.25 m: some vugs (size 5 - 20 mm), open

LIMESTONE (saccharoidal), beige, thick bedded to massive;
from 527.75 m to 528.00 m: vertical karstic fissure (aperture mm to 2 cm), filled with CLAYSTONE, light greenish grey;
from 527.90 m to 532.35 m: frequent vugs and fissures, coated or completely filled by CLAYSTONE, light greenish grey;
at 527.75 m, 528.80 m and at 528.90 m: chert nodule;
at 529.90 m, 531.25 m and at 532.15 m: sponge

LIMESTONE (saccharoidal), white, thin to medium bedded (ca. 10 - 20 cm) down to 524.48 m, below 524.48 m medium bedded (40 - 60 cm);
vertical karst fissures (aperture mm to 1 cm), partly open , other filled with CLAYSTONE, light greenish grey;
at 523.50 m: biodetritic layer;
at 523.90 m: belemnite;
at 524.60 m: pyrite nodule

LIMESTONE (saccharoidal), white, moderately fossiliferous (sponges frequent, bioclasts concentrated in layers [max. a few cm] from 518.10 m to 522.00 m), thick bedded, vugs (size
mm-cm) frequent, partly open;
at 516.70 m: brachiopod;
from 517.30 m to 517.45 m, 519.60 m to 519.90 m, 520.80 m to 521.00 m: vertical karstic fissures (aperture mm to 1 cm), some open, mostly filled with CLAYSTONE, light greenish grey;
at 519.20 m, 519.95 m, 521.45 m, 521.90 m, 522.25 m: chert nodule (size max. 8 cm);
at 516.75 m and at 521.45 m: pyrite nodule;
at 521.60 m: belemnite

LIMESTONE (wackestone, biomicrite), beige to white, sparsely fossiliferous, mainly thick bedded, close to the base (516.60 m) thin bedded;
from 510.40 m to 512.10 m and from 515.90 m to 516.60 m: vertical karst fissures (aperture mm to 1 cm), completely filled with CLAYSTONE, light greenish grey;
at 510.50 m and at 511.20 m: sponge;
from 511.60 m to 511.90 m: some bivalves;
at 512.22 m: belemnite;
at 514.20 m and at 514.50 m: layer of bioclasts

BIOHERMAL LIMESTONE (wackestone and boundstone, biomicrite), mostly dark greyish brown and beige grey, very fossiliferous (large sponges frequent [sponge bioherm], echinoderms),
medium bedded (ca. 30 cm);
interbeds (mostly <10 cm, max. 12 cm) of CALCAREOUS MARL, dark grey to black, very fossiliferous (many large sponges, echinoderms), laminated;
in LIMESTONES sponges getting less from top to base, therefore transition from top to base from boundstone to wackestone, rarely to mudstone;
at 704.49 m, 705.64 m, 706.65 m: ammonite;
at 704.49 m: bioclasts of sponges;
from 705.55 m to 706.14 m: abundant very large sponges (length max. 12 cm, width max. 3 cm), partly larger than the core diameter;
from 705.82 m to 707.67 m: LIMESTONE intraclasts (size max. 10 cm, micrite) and many bioclasts of sponges with interbeds of CALCAREOUS MARL

alternation of:
SILTY CLAYSTONE, calcareous, medium grey, in the lower part micaceous, moderately fossiliferous (bioclasts, dispersed bivalves); and
LIMESTONE, at the top and at the base argillaceous (mudstone and wackestone, biomicrite, in the lower part pelmicrite), light grey to medium grey and beige grey, moderately fossiliferous
(bioclasts, bivalves concentrated in layers [1 - 2 cm]);
from 734.97 to 735.84 m: SILTY MARL, medium grey, moderately fossiliferous (bioclasts, dispersed bivalves);
from 736.52 m to 736.56 m: coquina layer

SILTY CLAYSTONE, calcareous, sandy (fine-grained), dark grey, sparsely fossiliferous (dispersed bioclasts, a few bivalves), very micaceous and sparsely pyritic, moderately bioturbated
(mostly as burrows);
from 730.05 m to 730.50 m: CALCAREOUS MARL, medium grey to dark grey;
at 732.95 m: ammonite;
at 731.44 m and at 734.32 m: siderite nodule (size ca. 2 - 3 cm)

SILTY CLAYSTONE, calcareous, dark grey, very fossiliferous (bioclasts, bivalves);
with interbeds (max. 30 cm) of LIMESTONE, argillaceous (packstone, biomicrite), light grey, very fossiliferous (bioclasts, bivalves);
the two topmost LIMESTONE beds are nodular

succession dominated by iron-oolites:
from 724.85 m to 725.65 m: repeated gradual transition from LIMESTONE, iron-oolitic, light grey to medium grey, at the top, to MARL, iron-oolitic, medium grey to dark grey at the base,
very fossiliferous (large belemnites, bivalves [esp. oysters]);
from 725.65 m to 727.13 m: IRON-OOLITE, argillaceous, ochre brown to reddish brown and dark grey, very fossiliferous (bioclasts, bivalves [esp. oysters], belemnites, some crinoids);
at 725.08 m and at 726.88 m: ammonite; at 726.35 m: gastropod; at 726.41 m: brachiopod; at 727.10 m: coquina layer

from 723.90 m to 724.24 m: ONCOLITIC LIMESTONE, partly limonitised, medium grey, glauconitic, encrusted LIMESTONE clasts and bioclasts; from 724.24 m to 724.59 m: LIMESTONE, iron-oolitic, light grey to
dark beige, glauconitic, encrusted clasts of ONCOLITIC LIMESTONE in matrix of ARGILLACEOUS MARL; from 724.59 m to 724.85 m: MARL, iron-oolitic, dark grey, very glauconitic, very fossiliferous (belemnites);
at 724.15 m, 724.29 m, 724.30 m: ammonite

SILTY MARL, sandy (fine-grained), variegated, very micaceous;
subordinate SANDSTONE (fine- to coarse-grained), beige, very micaceous, poorly sorted, poorly cemented;
very subordinate ARGILLACEOUS MARL, partly sandy, reddish brown and beige grey

SILTSTONE, partly sandy (fine-grained), dark beige to beige, reddish brown and greyish pink;
subordinate SANDSTONE (mainly fine-grained), light grey to very light grey and beige, well sorted, well cemented (calcite);
very subordinate CLAYSTONE, calcareous, slightly sandy, reddish brown

SANDSTONE (mainly coarse-grained, less fine- to medium-grained), beige, from 182 m to 192 m with plagioclase in the range of 5-10% (subarkosic), poorly sorted, very poorly cemented,
most samples completely milled to loose sand, type Â«Granitischer SandsteinÂ»;
from 178 m to 180 m: SANDSTONE very micaceous;
from 188 m to 190 m: a few chips of coal, black

SANDSTONE (medium-grained), light grey, well sorted, moderately cemented (calcite);
very subordinate SILTSTONE, calcareous, beige and light grey, micaceous;
very subordinate ARGILLACEOUS MARL, light grey, dark reddish brown
